INSERT INTO `questions` (`id`, `staff_id`, `subject_id`, `question_type`, `level`, `class_id`, `section_id`, `class_section_id`, `question`, `opt_a`, `opt_b`, `opt_c`, `opt_d`, `opt_e`, `correct`, `explanation`, `descriptive_word_limit`, `created_at`, `updated_at`) VALUES
(50, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What are the four basic states of matter?', 'Solid Liquid Gas Plasma', 'Solid Water Air Fire', 'Rock Water Wind Cloud', 'Metal Wood Water Air', 'Electricity Heat Cold Light', 'opt_a', 'The four fundamental states of matter are solid, liquid, gas, and plasma. Each state has distinct molecular characteristics and behavior.', 0, '2025-03-24 23:30:35', NULL),
(51, 1, 3, 'true_false', 'low', 1, 1, NULL, 'All matter exists only in three states: solid', 'liquid', 'and gas.', 'true', 'false', '', '', '', 0, '2025-03-24 23:30:35', NULL),
(52, 1, 3, 'multichoice', 'medium', 1, 1, NULL, 'Which of the following are states of matter?', 'Solid', 'Liquid', 'Gas', 'Plasma', 'Water', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:30:35', NULL),
(53, 1, 3, 'singlechoice', 'high', 1, 1, NULL, 'Which state of matter has the most closely packed molecules?', 'Solid', 'Liquid', 'Gas', 'Plasma', '', 'opt_a', 'In a solid, molecules are tightly packed in a fixed position, giving it a definite shape and volume.', 0, '2025-03-24 23:30:35', NULL),
(54, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What is the characteristic of molecules in a liquid state?', 'Move freely but stay together', 'Completely random movement', 'Fixed position', 'No movement', '', 'opt_a', 'In a liquid, molecules can move around each other but remain close, allowing the liquid to flow and take the shape of its container.', 0, '2025-03-24 23:30:35', NULL),
(55, 1, 3, 'true_false', 'low', 1, 1, NULL, 'Liquids always take the shape of their container.', 'true', 'false', '', '', '', 'true', 'Liquids can flow and adapt to the shape of their container due to the mobility of their molecules.', 0, '2025-03-24 23:30:35', NULL),
(56, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'Which properties describe a liquid?', 'Definite volume', 'No fixed shape', 'Flows easily', 'Compressible', 'Incompressible', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:30:35', NULL),
(57, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'How do gas molecules behave?', 'Move very quickly and far apart', 'Stay close together', 'Remain stationary', 'Vibrate in fixed positions', '', 'opt_a', 'Gas molecules move rapidly and are spread far apart, which allows them to expand and fill their container completely.', 0, '2025-03-24 23:31:57', NULL),
(58, 1, 3, 'singlechoice', 'low', 1, 1, NULL, 'What happens when matter changes from solid to liquid?', 'Melting', 'Freezing', 'Evaporation', 'Condensation', '', 'opt_a', 'Melting is the process where a solid changes to a liquid by adding heat, increasing molecular movement.', 0, '2025-03-24 23:31:57', NULL),
(59, 1, 3, 'true_false', 'medium', 1, 1, NULL, 'Boiling is a change of state from liquid to gas.', 'true', 'false', '', '', '', 'true', 'Boiling occurs when a liquid is heated to its boiling point, causing it to change into a gaseous state.', 0, '2025-03-24 23:31:57', NULL),
(60, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'What changes occur during phase transitions?', 'Temperature change', 'Energy absorption', 'Energy release', 'Molecular rearrangement', 'Pressure change', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:31:57', NULL),
(61, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What is sublimation?', 'Direct change from solid to gas', 'Change from liquid to solid', 'Change from gas to liquid', 'Change from solid to liquid', '', 'opt_a', 'Sublimation is when a solid directly changes to a gas without passing through the liquid state, like dry ice (solid CO2).', 0, '2025-03-24 23:32:55', NULL),
(62, 1, 3, 'true_false', 'low', 1, 1, NULL, 'All changes in matter involve chemical reactions.', 'false', 'true', '', '', '', 'false', 'Not all changes in matter are chemical reactions. Some are physical changes that do not alter the chemical composition.', 0, '2025-03-24 23:32:55', NULL),
(63, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'What characterizes a physical change?', 'No new substance formed', 'Original composition maintained', 'Reversible process', 'Temporary change', 'Molecular rearrangement', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:32:55', NULL),
(64, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What is an example of a physical change?', 'Dissolving salt in water', 'Rusting of iron', 'Burning of paper', 'Cooking an egg', '', 'opt_a', 'Dissolving salt in water is a physical change because no new chemical substance is created, and the salt can be recovered by evaporation.', 0, '2025-03-24 23:32:55', NULL),
(65, 1, 3, 'true_false', 'low', 1, 1, NULL, 'Cutting paper is a chemical change.', 'false', 'true', '', '', '', 'false', 'Cutting paper is a physical change because it does not alter the chemical composition of the paper.', 0, '2025-03-24 23:32:55', NULL),
(66, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'Which processes are chemical changes?', 'Rusting', 'Burning', 'Cooking', 'Melting', 'Cutting', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:33:44', NULL),
(67, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What defines a reversible change?', 'Can return to original state', 'Permanent transformation', 'Complete destruction', 'Irretrievable loss', '', 'opt_a', 'In a reversible change, the original substance can be restored to its initial state through simple physical processes.', 0, '2025-03-24 23:33:44', NULL),
(68, 1, 3, 'true_false', 'low', 1, 1, NULL, 'Melting of ice is a reversible change.', 'true', 'false', '', '', '', 'true', 'Melting of ice is reversible because water can be frozen back to its solid state by removing heat.', 0, '2025-03-24 23:33:44', NULL),
(69, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'Which changes are reversible?', 'Dissolving sugar in water', 'Burning wood', 'Rusting of iron', 'Boiling water', 'Cutting paper', '[\"opt_a\"', 'opt_d]', 0, '2025-03-24 23:33:44', NULL),
(70, 1, 3, 'singlechoice', 'medium', 1, 1, NULL, 'What makes a change irreversible?', 'Permanent chemical transformation', 'Temporary physical alteration', 'Simple molecular movement', 'Reversible process', '', 'opt_a', 'Irreversible changes involve permanent chemical transformations that cannot be undone by simple physical processes.', 0, '2025-03-24 23:33:44', NULL),
(71, 1, 3, 'true_false', 'low', 1, 1, NULL, 'Cooking an egg is a reversible change.', 'false', 'true', '', '', '', 'false', 'Cooking an egg is an irreversible change because the egg proteins permanently change structure and cannot return to their original raw state.', 0, '2025-03-24 23:33:44', NULL),
(72, 1, 3, 'multichoice', 'high', 1, 1, NULL, 'Which are examples of irreversible changes?', 'Burning paper', 'Rusting of iron', 'Cooking food', 'Melting ice', 'Cutting cloth', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:33:44', NULL),
(73, 1, 2, 'singlechoice', 'medium', 1, 1, NULL, 'निम्नलिखित वाक्य में कौन सा काल है? \"मैं कल स्कूल जाऊंगा।\"', 'भूतकाल', 'वर्तमान काल', 'भविष्य काल', 'संदिग्ध काल', '', 'opt_c', 'भविष्य काल उन क्रियाओं के लिए प्रयोग किया जाता है जो भविष्य में होने वाली हैं। यहाँ \'जाऊंगा\' भविष्य काल का संकेत देता है।', 0, '2025-03-24 23:36:23', NULL),
(74, 1, 2, 'true_false', 'low', 1, 1, NULL, 'संज्ञा शब्द किसी व्यक्ति', 'वस्तु', 'स्थान या भाव के नाम को कहते हैं।', 'true', 'false', '', '', '', 0, '2025-03-24 23:36:23', NULL),
(75, 1, 2, 'multichoice', 'medium', 1, 1, NULL, 'निम्न में से कौन-कौन से सर्वनाम के भेद हैं?', 'पुरुषवाचक', 'निश्चयवाचक', 'अनिश्चयवाचक', 'संबंधवाचक', 'प्रश्नवाचक', '[\"opt_a\"', 'opt_b', 0, '2025-03-24 23:36:23', NULL),
(76, 1, 2, 'singlechoice', 'low', 1, 1, NULL, 'किस शब्द को किसी काम करने या होने की क्रिया कहते हैं?', 'क्रिया', 'संज्ञा', 'विशेषण', 'सर्वनाम', '', 'opt_a', 'क्रिया वह शब्द है जो किसी काम करने या होने की अवस्था को दर्शाता है।', 0, '2025-03-24 23:36:23', NULL),
