(80, 1, 2, 'true_false', 'low', 1, 1, NULL, 'मुहावरे का अर्थ शब्दों के अर्थ से अलग होता है।', 'true', 'false', '', '', '', 'true', 'मुहावरे के अर्थ सीधे शब्दों के अर्थ से नहीं मिलते, बल्कि उनका एक विशेष अर्थ होता है।', 0, '2025-03-24 23:37:11', NULL),
